        <button onClick={getPvz(7)}>Пвз 7</button>
        <button onClick={getPvz(8)}>Пвз 8</button> */}
        {/* {pvz.address} */}
        {pvz ? 
        <div>
            Информация о ПВЗ
            <div>Продавец {pvz.producer}</div>
            <div>Город {pvz.city}</div>
            <div>Адресс {pvz.address}</div>
            <div></div>
        </div> 
        :   <div>
                Пвз не найден
            </div>}
    </div> );
}
 
export default GetPvz;
